import React, { FC } from "react";
import { View } from "react-native";
import { ListItem, ThemeProvider } from "react-native-elements";

const TodoList: FC = () => {
  const todos = ["GO言語を勉強する", "英単語を覚える"];

  return (
    <ThemeProvider>
      <View>
        {todos.map((todo) => (
          <ListItem key={todo}>
            <ListItem.Content buttomDivider>
              <ListItem.Title>{todo}</ListItem.Title>
            </ListItem.Content>
          </ListItem>
        ))}
      </View>
    </ThemeProvider>
  );
};

export default TodoList;
